import React from "react";
import "./navbar.css";

function Navbar() {
  return (
   <div className="header">

    <ul>

     <li>
       <a href="#">Accueil</a>
     </li>
     <li>
       <a href="#">Equipe</a>
     </li>

   </ul>
   </div>
  );
}

export default Navbar;
